func testRecordToManyRemoveOpMetrics(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a Record
	var b, c, d, e Metric

	seed := randomize.NewSeed()
	localComplelementList := strmangle.SetComplement(recordPrimaryKeyColumns, recordColumnsWithoutDefault)
	if err = randomize.Struct(seed, &a, recordDBTypes, false, localComplelementList...); err != nil {
		t.Fatal(err)
	}

	foreignComplementList := strmangle.SetComplement(metricPrimaryKeyColumns, metricColumnsWithoutDefault)
	foreignComplementList = append(foreignComplementList, metricColumnsWithCustom...)

	foreigners := []*Metric{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, metricDBTypes, false, foreignComplementList...); err != nil {
			t.Fatal(err)
		}
		x.Release = custom_types.NullReleaseRandom()
		x.Type = custom_types.DataTypeRandom()

	}

	if err := a.Insert(tx); err != nil {
		t.Fatal(err)
	}

	err = a.AddMetrics(tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.MetricsByFk(tx).Count()
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveMetrics(tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.MetricsByFk(tx).Count()
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if len(b.R.Records) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if len(c.R.Records) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if d.R.Records[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}
	if e.R.Records[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}

	if len(a.R.Metrics) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.Metrics[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.Metrics[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

